import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="NavBar">
      <img src={logo} alt="logo" className="Logo-1"/>
      <div className="Top-bar"> 
      <i className="Geopossition"></i>
      <p className="Address">г. Москва, ул. Вешних вод, 4с170</p>
      </div>
    </div>
  );
}

export default App;
